import React from 'react';
import plantList from '../datas/plantList'
export default function Pannier() {
  return (
    <div className='card shadow-lg m-3 p-3'>
      <div className='d-flex justify-content-center gap-3'>
         <select >
          {plantList.map((options,index)=>{
            return <option key={index+1} value={options.category}> {options.category}</option>
          })}
        </select><button>Search</button>
      </div>
      {plantList.map((imgs)=>{
            return <div className='container'>
            <div className="row">
            <div className="col-lg-3">
                      <div className="card" >
                     <img src={imgs[0]} className="card-img-top" alt="image1"/>
                     <div className="card-body">
                       <h5 className="card-title">iphone 14</h5>
                       <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                       <button href="#" className="btn btn-primary">add to card </button>
                     </div>
                      </div>
                      </div>
            </div>
            </div>
          })}
     
        
    </div>
  )
}
